import React from "react";

function Apps() {
  const users = [
    { id: 1, name: "Ravi" },
    { id: 2, name: "Anu" },
    { id: 3, name: "Kiran" },
  ];

  return (
    <div>
      <h2>User List</h2>

      {users.map((user) => (
        <p key={user.id}>{user.name}</p>
      ))}
    </div>
  );
}

export default Apps;
